Снежанка обичала авокадо 🥑

Защо ли? Защото си бях наумила да направя салата „Снежанка“, обаче едно авокадо направо ми бодеше очите от хладилника и си казах: „Абе аз мога или не мога?!“. Мога, разбира се. Стана – споделям. Ето ви една малко по-различна идея за свежа лятна салата, моята още по-страхотна, защото краставиците са ми от мама🥰

Необходими продукти:
-	2 краставици;
-	200-250 гр. кисело мляко;
-	1 авокадо;
-	малко сол и зехтин;
-	по желание – скилидка чесън, копър и орехи.

Начин на приготвяне:
Авокадото се пасира с киселото мляко, солта и зехтина. Ако желаете, добавете накълцан копър и скилидка чесън (или две). Получената смес разбъркайте със ситно нарязани краставици. Реших да не ги беля, защото щяха да се загубят в зеления цвят на основата. При мен има чесън и орехи, само копър не сложих.

