КОНФЕТКИ БЕЗ ВРЕДА

Давно не покупаю магазинных конфет, беру исключительно качественный горький шоколад с содержанием какао не менее 80%. 
Либо делаю такие вот домашние конфеты из микса орехов и сухофруктов. 

🍃 нужно;
· микс любых орехов на выбор (миндаль, фундук, грецкий, кешью, фисташка);
· финики (или финики с курагой); 
· овсяные хлопья;
· какао-порошок.

Орехи предварительно замочить в воде на несколько часов (чтобы размягчить их и избавиться от вредной для организма фитиновый кислоты*). Финики/курагу залить на 10 мин. кипятком, затем слить воду и измельчить в чаше блендера вместе с орехами и овсяными хлопьями (по желанию).

Сформировать шарики и обвалять их в какао-порошке. Часть конфет можно дополнительно обвалять в измельчённых овсяных хлопьях, кокосовой стружке или в семенах конопли (на фото – они).

* про замачивание и фитиновую кислоту у меня на странице есть целый пост.

